import { v4 as uuidv4 } from "uuid";

const dataSlider = [
  {
    id: uuidv4(),
    title: "Lorem ipsum 1",
    subTitle: "Lorem",
  },
  {
    id: uuidv4(),
    title: "Lorem ipsum 2",
    subTitle: "Lorem",
  },
  {
    id: uuidv4(),
    title: "Lorem ipsum 3",
    subTitle: "Lorem",
  },
  {
    id: uuidv4(),
    title: "Lorem ipsum 4",
    subTitle: "Lorem",
  },
  {
    id: uuidv4(),
    title: "Lorem ipsum 5",
    subTitle: "Lorem",
  },
];

export default dataSlider;
